import React from "react";
import {
    BrowserRouter,
    Routes,
    Route
  } from "react-router-dom";

/**
 * Import all page components
 */
import App from './components/App'
import Main from './components/Main'

/**
 * All routes go here
 */
export default (
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<App />}>
                <Route index element={<Main />}/>
            </Route>
        </Routes>
    </BrowserRouter>
);
